sympy.sympy.core.decorators.__sympifyit_:
@wraps(func)
def __sympifyit_wrapper(a, b):
    try:
        # If an external class has _op_priority, it knows how to deal
        # with SymPy objects. Otherwise, it must be converted.
        if not hasattr(b, '_op_priority'):
            b = sympify(b, strict=True)
        return func(a, b)
    except SympifyError:
        return retval

sympy.sympy.core.numbers.__eq__:
def __eq__(self, other):
    try:
        other = _sympify(other)
    except SympifyError:
        return NotImplemented
    if self is other:
        return True
    if other.is_Number and self.is_irrational:
        return False

    return False    # NumberSymbol != non-(Number|self)

sympy.sympy.external.pythonmpq.__eq__:
def __eq__(self, other):
    """Compare equal with PythonMPQ, int, float, Decimal or Fraction"""
    if isinstance(other, PythonMPQ):
        return (self.numerator == other.numerator
            and self.denominator == other.denominator)
    elif isinstance(other, self._compatible_types):
        return self.__eq__(PythonMPQ(other))
    else:
        return NotImplemented

sympy.sympy.physics.vector.frame.__eq__:
def __eq__(self, other):
    # Check if the other object is a CoordinateSym of the same frame and
    # same index
    if isinstance(other, CoordinateSym):
        if other._id == self._id:
            return True
    return False

sympy.sympy.polys.agca.extensions.__eq__:
def __eq__(f, g):
    if isinstance(g, ExtElem):
        return f.rep == g.rep and f.ext == g.ext
    else:
        return NotImplemented

sympy.sympy.polys.domains.gaussiandomain:
def __eq__(self, other) -> bool:
    if isinstance(other, self.__class__):
        return self.x == other.x and self.y == other.y
    else:
        return NotImplemented

